/// folder_id : {"id":5,"name":"HR"}
/// datas : ""
/// display_name : "Discipline_Type.png"

class Document_detail {
  int _id;
  String _name;
  Folder_id _folderId;
  String _datas;
  String _displayName;
  String _type;

  int get id => _id;
  String get name => _name;
  Folder_id get folderId => _folderId;
  String get datas => _datas;
  String get displayName => _displayName;
  String get type =>_type;

  Document_detail({
      int id, 
      String name, 
      Folder_id folderId, 
      String datas, 
      String displayName}){
    _id = id;
    _name = name;
    _folderId = folderId;
    _datas = datas;
    _displayName = displayName;
}

  Document_detail.fromJson(dynamic json) {
    _id = json["id"];
    _name = json["name"];
    _folderId = json["folder_id"] != null ? Folder_id.fromJson(json["folder_id"]) : null;
    _datas = json["datas"];
    _displayName = json["display_name"];
    _type = json["mimetype"];
  }

  Map<String, dynamic> toJson() {
    var map = <String, dynamic>{};
    map["id"] = _id;
    map["name"] = _name;
    if (_folderId != null) {
      map["folder_id"] = _folderId.toJson();
    }
    map["datas"] = _datas;
    map["display_name"] = _displayName;
    return map;
  }

}

/// id : 5
/// name : "HR"

class Folder_id {
  int _id;
  String _name;

  int get id => _id;
  String get name => _name;

  Folder_id({
      int id, 
      String name}){
    _id = id;
    _name = name;
}

  Folder_id.fromJson(dynamic json) {
    _id = json["id"];
    _name = json["name"];
  }

  Map<String, dynamic> toJson() {
    var map = <String, dynamic>{};
    map["id"] = _id;
    map["name"] = _name;
    return map;
  }

}